suite("Array",function(){suite("#indexOf()",function(){var e=32;suiteSetup(function(t){e.should.eql(32),e=42,t()}),test("should return -1 when the value is not present",function(){e.should.eql(42),[1,2,3].indexOf(5).should.equal(-1),[1,2,3].indexOf(0).should.equal(-1)}),test("should return the correct index when the value is present",function(){e.should.eql(42),[1,2,3].indexOf(1).should.equal(0),[1,2,3].indexOf(2).should.equal(1),[1,2,3].indexOf(3).should.equal(2)}),test.skip("should skip this test",function(){var e=0;e.should.equal(1,"this test should have been skipped")}),suiteTeardown(function(t){e.should.eql(42),t()})})});